import "../../App.css";
import { Grid } from "@material-ui/core";
import logo from "./SyImg/logo3.png";

export default function AboutUs() {
  return (
    <div>
      <div className="about">
        <h3>SY MAKINA HAKKINDA</h3>
      </div>
      <Grid container spacing={6}>
        <Grid item xs={6} md={12}>
          <img src={logo} alt="" />
        </Grid>
        <Grid item xs={6}>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Suscipit
          magni numquam quasi quo perspiciatis sint corrupti, odio deserunt
          blanditiis commodi, ab expedita deleniti pariatur facilis veritatis
          natus iure labore quaerat.
        </Grid>
      </Grid>
    </div>
  );
}
